import React from "react";
import Grid from "@mui/joy/Grid";
import { useNavigate } from "react-router-dom";
import Typography from "@mui/material/Typography";
import PersonIcon from "@mui/icons-material/Person";
import Divider from "@mui/material/Divider";
import ButtonBase from "@mui/material/ButtonBase";
import AddCircleIcon from "@mui/icons-material/AddCircle";
import ModeIcon from "@mui/icons-material/Mode";
import ClearIcon from "@mui/icons-material/Clear";
import axios from "axios";
import { useCookies } from "react-cookie";
import Modal from "./modal";

export default function Spese() {
  const [cookies, setCookie] = useCookies(["session"]);
  const navigate = useNavigate();
  const [spese, setSpese] = React.useState([]);
  const [render, setRender] = React.useState(false);

  React.useEffect(() => {
    if (cookies && Object.keys(cookies).length > 0) {
    } else {
      navigate("/", { replace: true });
    }
  }, [cookies]);

  React.useEffect(() => {
    axios
      .get("http://localhost:3002/expenses")
      .then((response) => {
        console.log(response);
        setSpese(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, [render]);

  const [isModalOpen, setIsModalOpen] = React.useState(false);

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };

  return (
    <Grid
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
      style={{
        height: "100%",
        width: "100%",
        backgroundColor: "rgb(20, 42, 58)",
      }}
    >
      <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="center"
        style={{
          height: "90%",
          width: "80%",
          //backgroundColor: "rgb(203, 231, 253)",
        }}
      >
        <Grid
          container
          direction="row"
          justifyContent="flex-start"
          alignItems="center"
          style={{
            height: "10%",
            width: "100%",
            //backgroundColor: "rgb(94, 175, 70)",
          }}
        >
          <Typography
            variant="h4"
            style={{ color: "#fcfcfc" }}
            sx={{ fontWeight: "bold" }}
          >
            Spese page
          </Typography>
        </Grid>
        <Grid
          container
          direction="column"
          style={{
            borderRadius: "5%",
            height: "90%",
            width: "100%",
            backgroundColor: "rgb(203, 231, 253)",
          }}
        >
          <Grid
            container
            direction="column"
            justifyContent="center"
            style={{
              height: "79%",
              width: "100%",
              //backgroundColor: "rgb(93, 131, 53)",
            }}
          >
            <Grid
              container
              direction="row"
              justifyContent="flex-end"
              alignItems="center"
              style={{
                height: "10%",
                width: "100%",
                //backgroundColor: "rgb(193, 231,153)",
              }}
            >
              <ButtonBase
                style={{
